import React, { Fragment, Component } from 'react'

class ClassAverage extends Component {

    render() {
       const style={
            borderRadius: "20px",
            boxShadow: "2px"
        }
        return(
            <Fragment>
                <h2>Class III</h2>
                <h6>{'totalStudent'}Students</h6>
                <div className="btn btn-info pull-right mr-4 " style={style}>Show Average</div>

                <br/><br/>
                <hr style={{background: "blue", height: "5px", width: "100%"}}/>
            </Fragment>
        )
    }
}
export default ClassAverage
